export function generateQuote(quoteList: string[]): string {
    do {
        const { length: listLength } = quoteList
        const randomIndex = Math.ceil(Math.random() * (listLength - 1) + 1);
        if(quoteList[randomIndex])
            return quoteList[randomIndex]
    } while(true)
}
